import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS Attempt')</script>";

    // Locate the search input field using its ID
    const searchInputSelector = '#searchInput';
    await page.waitForSelector(searchInputSelector, { timeout: 5000 });

    // Type the XSS payload into the search input
    await page.locator(searchInputSelector).fill(xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate the search button using its class and click it
    const searchButtonSelector = '.search-btn';
    await page.waitForSelector(searchButtonSelector, { timeout: 5000 });
    await page.locator(searchButtonSelector).first().click();

    // Take a screenshot after submitting the search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    // Extract the value from the input to confirm it was entered
    const finalInputValue = await page.locator(searchInputSelector).inputValue();

    return {
      success: true,
      action: "Attempted XSS by entering a script payload into the search input and clicking the search button.",
      extractedData: {
        payloadUsed: xssPayload,
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
